},{"name":"LICENSE","path":"LICENSE","contentType":"file"},{"name":"README.md","path":"README.md","contentType":"file"},{"name":"Xmodmap","path":"Xmodmap","contentType":"file"},{"name":"bashrc","path":"bashrc","contentType":"file"},{"name":"gtkrc-2.0","path":"gtkrc-2.0","contentType":"file"},{"name":"install.py","path":"install.py","contentType":"file"},{"name":"screenrc","path":"screenrc","contentType":"file"}],"totalCount":18}},"fileTreeProcessingTime":10.308576,"foldersToFetch":[],"repo":{"id":5697090,"defaultBranch":"master","name":"dotfiles","ownerLogin":"wookayin","currentUserCanPush":false,"isFork":false,"isEmpty":false,"createdAt":"2012-09-06T03:42:36.000Z","ownerAvatar":"https://avatars.githubusercontent.com/u/1009873?v=4","public":true,"private":false,"isOrgOwned":false},"codeLineWrapEnabled":false,"symbolsExpanded":false,"treeExpanded":true,"refInfo":{"name":"bf5ac191c454e5347cf8d7a97e509cc707afd78e","listCacheKey":"v0:1707790153.0","canEdit":false,"refType":"tree","currentOid":"bf5ac191c454e5347cf8d7a97e509cc707afd78e"},"path":"nvim/lua/config/pynvim.lua","currentUser":null,"blob":{"rawLines":["--- config/pynvim","---@return fun(): boolean","-- Set the g:python3_host_prog variable to path to python3 in $PATH.","-- pynvim package will be automatically installed if it was missing.","","-- This config must be sourced before any first call of has('python3'), py3eval, etc.","-- Note: An invocation of has('python3'), py3, py3eval triggers provider#python3#Call()","-- See also $VIMRUNTIME/autoload/provider/python3.vim that provides python3 host","-- See also $VIMRUNTIME/autoload/provider/pythonx.vim for python host detection logic","-- See also $DOTVIM/ftplugin/python.vim to ensure config.pynvim on startup","","-- for future has('python3') like use","local OK_PYNVIM = function() return true end","local NO_PYNVIM = function() return false end","","-- Utility: Run a shell command and capture the output.","local function system(command)","  local file = assert(io.popen(command, 'r'))","  local output = file:read('*all'):gsub(\"%s+\", \"\")","  file:close()","  return output","end","","local function echom(msg, hlgroup)","  vim.api.nvim_echo({{ msg, hlgroup }}, true, {})","end","local function warning(msg)","  echom(msg, 'WarningMsg')","end","local function notify_later(msg, level)","  level = level or vim.log.levels.WARN","  vim.schedule(function()","    vim.notify(msg, level, {","      title = '~/.config/nvim/lua/config/pynvim.lua', timeout = 10000,","      markdown = true,","    })","  end)","end","","-- If the environment variable $PYTHON3_HOST_PROG is set, use that as the python rplugin host.","if os.getenv('PYTHON3_HOST_PROG') then","  vim.g.python3_host_prog = os.getenv('PYTHON3_HOST_PROG')","end","","-- By default, use python3 w.r.t. $PATH as the host python for neovim.","if vim.g.python3_host_prog == \"\" or not vim.g.python3_host_prog then","  vim.g.python3_host_prog = vim.fn.exepath(\"python3\")","end","","if vim.g.python3_host_prog == \"\" or not vim.g.python3_host_prog then","  warning \"ERROR: You don't have python3 on your $PATH. Check $PATH or $SHELL. Most features are disabled.\"","  return NO_PYNVIM","end","","-- Note: should not use py3eval here because python3 provider is slow, and may not work!","---@type fun(): nil|table[]  returns a version tuple, e.g., { 3, 11, 5 }; or nil if python3 failed","local python3_version = setmetatable({ _version = nil }, { __call = function(self)","  if self._version then","    return self._version","  end","  local s = system(vim.g.python3_host_prog .. \" -W ignore -c 'import sys; print(list(sys.version_info)[:3])' 2\u003e/dev/null\")","  self._version = vim.F.npcall(vim.json.decode, s) or nil","  return self._version","end}) --[[@as function]]","","","local function determine_pip_args()","  local pip_option = \"--upgrade --force-reinstall \"  -- force option is important","  local has_mac = vim.fn.has('mac') \u003e 0","","  if not has_mac then  -- for Linux","    -- Use '--user' option when needed","    local py_prefix = system(\"python3 -c 'import sys; print(sys.prefix)' 2\u003e/dev/null\")","    if py_prefix == \"/usr\" or py_prefix == \"/usr/local\" then","      pip_option = pip_option .. \"--user \"","    end","  end","","  -- local py_version = python3_version()","  -- if needs_pynvim_nightly then","  --  return pip_option .. [[ 'pynvim @ git+https://github.com/neovim/pynvim' ]]","  -- end","  return pip_option .. \"pynvim\"","end","","-- This works \"synchronously\", blocks until the pip command terminates","---@return boolean whether installation is successful","local function autoinstall_pynvim()","  if vim.fn.exepath(vim.g.python3_host_prog) == \"\" then","    return false","  end","","  -- Ensure pynvim \u003e= 0.4.0.","  local python3_neovim_version = system(assert(vim.g.python3_host_prog) ..","    \" -W ignore -c 'import pynvim; print(pynvim.VERSION.minor)' 2\u003e/dev/null\")","  local needs_install = tonumber(python3_neovim_version) == nil or tonumber(python3_neovim_version) \u003c 4","  if not needs_install then","    return false","  end","","  vim.api.nvim_echo({{ \"Automatically installing pynvim for: \" .. vim.g.python3_host_prog .. \" ...\", \"Moremsg\" }}, true, {})","  vim.loop.sleep(100)","  vim.cmd [[ redraw! ]]","","  local python = vim.g.python3_host_prog","  vim.g.pynvim_install_command = table.concat({","    \"(\" .. python .. \" -c 'import pip' || \" .. python .. \" -m ensurepip \" .. \")\",","    python .. \" -m pip install \" .. determine_pip_args(),","    python .. [[ -c 'import pynvim; print(\"pynvim:\", pynvim.__file__)' ]]","  }, \" \u0026\u0026 \")","","  -- !shell execution cannot have a fine-grained control, so we use jobstart() or termopen()","  _G.pynvim_handler = setmetatable({","    console = '',","    __call = function(self, job_id, lines, event)","      -- On stdout line streamed, inform users what's going on","      if event == 'stdout' then","        lines = table.concat(lines, '\\n')","        for _, line in pairs(vim.split(lines, '\\n')) do","          print(line)","          -- Note: nvim_echo doesn't flush despite redraw, and the overflowing lines are annoying","          -- vim.api.nvim_echo({{ line, 'MoreMsg' }}, true, {})","          vim.cmd [[ redraw! ]]","        end","        self.console = self.console .. lines","      -- On stderr, collect and show at once","      elseif event == 'stderr' then","        lines = table.concat(lines, '\\n')","        self.console = self.console .. lines","      end","    end,","    --- Show stderr messages in a scratchpad","    show_stderr = vim.schedule_wrap(function(self)","      if #self.console \u003e 0 then","        vim.cmd [[ tabnew ]]","        vim.cmd [[ setlocal buftype=nofile bufhidden=hide noswapfile nonumber ]]","        vim.api.nvim_buf_set_lines(0, 0, -1, false, vim.split(self.console, '\\n'))","        vim.api.nvim_buf_set_name(0, vim.g.pynvim_install_command)","        vim.bo[0].filetype = 'log'  -- Use some highlighting","      end","    end),","  }, { __call = function(self, ...) return self:__call(...) end })","","  vim.cmd [[","    \" Note: Unlike jobstart(), termopen() cannot use on_stderr (neovim/neovim#23660)","    echom g:pynvim_install_command","    let jobid = jobstart(['bash', '-x', '-c', g:pynvim_install_command], {","        \\  'on_stdout': { j,d,e -\u003e v:lua.pynvim_handler(j,d,e) },","        \\  'on_stderr': { j,d,e -\u003e v:lua.pynvim_handler(j,d,e) },","        \\})","    let retcode = jobwait([jobid])[0]","    if retcode == -2","      call v:lua.pynvim_handler(jobid, ['ERROR: Interrupted'], 'stderr')","    endif","    exec printf('silent !exit %d', retcode)","  ]]","","  if vim.v.shell_error == 0 then","    local msg = \"Successfully installed pynvim. Please restart neovim.\"","    echom(msg, \"MoreMsg\")","    notify_later(msg .. \"\\n\" .. \"Run `:messages` to see installation logs.\", vim.log.levels.INFO)","    _G.pynvim_handler = nil","    return true","  else","    _G.pynvim_handler:show_stderr()","    local msg = \"Failed to install pynvim on \" .. assert(vim.g.python3_host_prog)","    warning(msg)","    notify_later(msg, vim.log.levels.ERROR)","    return false","  end","end","","-- python version check. returns true of everything is OK.","---@return boolean","local function python3_version_check()","  local py_version = python3_version()  ---@type integer[]|nil","  if py_version and (","    py_version[1] \u003e 3 or","    py_version[1] == 3 and py_version[2] \u003e= 7  -- requires python 3.7+","  ) then","    return true","  end","","  local msg","  if py_version then","    msg = string.format(\"Your python3 version (%s) is too old;\", table.concat(py_version, \".\"))","  elseif vim.fn.exists(vim.g.python3_host_prog) == 0 then","    msg = (\"python3_host_prog does not exist.\"):format(vim.g.python3_host_prog)","  else","    msg = (\"python3 version cannot be detected.\")","  end","  do","    warning(msg .. \" g:python3_host_prog = \" .. vim.g.python3_host_prog)","    msg = msg .. '\\n' .. \"python 3.7+ is required. Most features are disabled.\\n\"","    msg = msg .. '\\n' .. \"g:python3_host_prog = \" .. vim.g.python3_host_prog","    msg = msg .. '\\n' .. \"exepath = \" .. vim.fn.exepath(vim.g.python3_host_prog)","    notify_later(msg)","  end","  return false","end","","-- Make a dummy call first, to workaround a bug neovim/neovim#14438 and neovim/pynvim#496","-- At this point the python3 provider will be loaded. py3eval() may throw if python3 host cannot be loaded.","-- NOTE: This takes some init time (~50ms), but is necessary otherwise other python plugins will fail","pcall(vim.fn.py3eval, \"1\")  -- TODO: Remove this workaround once pynvim 0.5 is out.","","if vim.F.npcall(vim.fn.py3eval, \"1\") ~= 1 then","  -- python3 host has failed to load.","  local py_version = python3_version_check()","  if not py_version then","    return NO_PYNVIM","  end","","  -- pynvim is missing, try installing it","  xpcall(autoinstall_pynvim, function(err)","    local msg = debug.traceback(err, 1)","    vim.notify(msg, vim.log.levels.ERROR)","  end)","","  -- Disable autocmds from already-generated rplugins manifest,","  -- which will emit annoying errors on CmdlineEnter, VimLeave, etc.","  vim.schedule(function()","    xpcall(function()","      local groups = vim.fn.split(vim.fn.execute('augroup'))","      for _, augroup in ipairs(groups) do","        if vim.startswith(augroup, \"RPC_DEFINE_AUTOCMD_GROUP_\") then","          vim.cmd(([[ autocmd! %s ]]):format(augroup))","        end","      end","    end, function(err)","      local msg = err -- no need stacktrace here","      vim.api.nvim_err_writeln(msg)","    end)","  end)","","  -- Still need to disable python3 provider, it's already broken","  vim.g.loaded_python3_provider = 1  -- Disable has('python3')","  return NO_PYNVIM","else","  -- pynvim already there, check versions lazily","  vim.schedule(function()","    autoinstall_pynvim()","    python3_version_check()","  end)","end","","-- Return true iff python3 is available.","-- Instead of calling has('python3'), use require('config.pynvim').","return OK_PYNVIM"],"stylingDirectives":[[{"s":0,"e":17,"c":"pl-c"},{"s":0,"e":3,"c":"pl-c"}],[{"s":0,"e":25,"c":"pl-c"},{"s":0,"e":3,"c":"pl-c"},{"s":3,"e":10,"c":"pl-k"},{"s":11,"e":14,"c":"pl-k"},{"s":14,"e":18,"c":"pl-k"},{"s":18,"e":25,"c":"pl-c1"}],[{"s":0,"e":68,"c":"pl-c"},{"s":0,"e":2,"c":"pl-c"}],[{"s":0,"e":68,"c":"pl-c"},{"s":0,"e":2,"c":"pl-c"}],[],[{"s":0,"e":85,"c":"pl-c"},{"s":0,"e":2,"c":"pl-c"}],[{"s":0,"e":87,"c":"pl-c"},{"s":0,"e":2,"c":"pl-c"}],[{"s":0,"e":80,"c":"pl-c"},{"s":0,"e":2,"c":"pl-c"}],[{"s":0,"e":85,"c":"pl-c"},{"s":0,"e":2,"c":"pl-c"}],[{"s":0,"e":74,"c":"pl-c"},{"s":0,"e":2,"c":"pl-c"}],[],[{"s":0,"e":37,"c":"pl-c"},{"s":0,"e":2,"c":"pl-c"}],[{"s":0,"e":5,"c":"pl-k"},{"s":6,"e":15,"c":"pl-en"},{"s":16,"e":17,"c":"pl-k"},{"s":18,"e":26,"c":"pl-k"},{"s":29,"e":35,"c":"pl-k"},{"s":36,"e":40,"c":"pl-c1"},{"s":41,"e":44,"c